var UiObjectBase = require("./ui_object_base.js");
var UiObjectBaseTO = UiObjectBase.UiObjectBaseTO;
var UiObjectBaseDescription = UiObjectBase.UiObjectBaseDescription;

/**
 * The description of a UIAPro tab item test object.
 * @param {Object} [props] Initializes a UIAPro Tab Item test object using the supplied property bag.
 * @returns {TabItem} the description object that was initialized.
 * @class TabItem
 * @extends UIAPro.UiObjectBaseDescription
 * @memberof UIAPro
 */
function TabItem(props) {
    var tabItemDesc = new UiObjectBaseDescription("TabItem");

    tabItemDesc._defineByPropertyBag(props);
    return tabItemDesc;
}

/**
 * A UIAPro tab item.
 * @constructor
 * @class TabItemTO
 * @extends UIAPro.UiObjectBaseTO
 * @memberof UIAPro
 */
function TabItemTO(session, description) {
    description = description || TabItem();
    var tabItemTO = new UiObjectBaseTO("UIAProTabItem", session, description);

    return tabItemTO;
}

module.exports.TabItemTO = TabItemTO;
module.exports.TabItem = TabItem;